import styled from "styled-components";

export const SideBarContainer = styled.div`
  width: 15%;
`;

export const ContentContainer = styled.div`
  flex: 6;
`;

export const DashboardContainer = styled.div`
  display: flex;
  flex-direction: row;
`;

export const TopBarContainer = styled.div`
  width: 100%;
`;
